styles:
* {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
}

body {
    font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif;
    background-color: #f5f5f5;
    min-height: 100vh;
}

.container {
    width: 100%;
    max-width: 700px;
    padding: 20px;
    margin: 0 auto;
    min-height: 100vh;
    display: flex;
    flex-direction: column;
}

.logo {
    text-align: center;
    padding: 20px;
}

.company-logo {
    max-width: 200px;
    height: auto;
}

.warning-card {
    background: white;
    border-radius: 16px;
    padding: 32px;
    box-shadow: 0 4px 24px rgba(0, 0, 0, 0.05);
    text-align: center;
}

.main-content {
    flex: 1;
    display: flex;
    align-items: center;
    justify-content: center;
    padding: 20px;
}

.vpn-icon {
    margin-bottom: 24px;
}

.vpn-image {
    width: 200px;
    height: auto;
}

h1 {
    color: #333;
    font-size: 24px;
    margin-bottom: 16px;
    font-weight: 600;
}

p {
    color: #666;
    font-size: 16px;
    line-height: 1.5;
}

@media (max-width: 480px) {
    body {
        min-height: 100vh;
        display: flex;
        flex-direction: column;
    }

    .container {
        padding: 0;
        flex: 1;
        display: flex;
        flex-direction: column;
    }

    .logo {
        position: sticky;
        top: 40px;
        background-color: #f5f5f5;
        z-index: 100;
    }

    .main-content {
        flex: 1;
        padding: 16px;
        position: absolute;
        top: 0;
        left: 0;
        right: 0;
        bottom: 0;
    }

    .warning-card {
        padding: 24px;
        width: 100%;
        display: flex;
        flex-direction: column;
    }

    h1 {
        font-size: 28px;
    }

    p {
        font-size: 20px;
    }
}
